(function(){$(function(){var form;form=$("#form");return form.submit(function(e){$.ajax({url:form.attr("action"),type:form.attr("method"),data:form.serialize(),success:function(data){var err,_i,_len,_ref,_results;$("#error-container").empty();if(data.redirect_to){return window.location.href=data.redirect_to}else if(data.errors){_ref=data.errors;_results=[];for(_i=0,_len=_ref.length;_i<_len;_i++){err=_ref[_i];_results.push($("#error-container").append("<p>"+err+"</li>"))}return _results}}});console.log(form.serialize());return e.preventDefault()})})}).call(this);